    "Development of a Complex Geometry Standard Fixture and Solvent Evaluation Method
    fo Assessing Replacement Solvents for AK-225G Project",nt"tracking_summary":
    {ntt"total": 7,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:16:21.721825",nt"name": "development-of-a-complex-geometry-standard-fixture-and-solvent-evaluation-method-fo-assess",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;&lt;strong&gt;The focus of this
    analysis was the development of a complex geometry test fixture and test method
    for determining solvent cleaning efficiency. AK-225 belongs to a class of chemicals
    called HCFC and is used for cleaning, drying and lubricant deposition applications.
    These compounds are regulated by the U.S Clean Air Act and can no longer be produced
    or imported into the United states.&amp;nbsp; Any alternative solvent must be able
    to dissolve the soil/contaminant on the part.&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;strong&gt;The
    determination of an environmentally safe but reliable quality cleaning solvent is
    critical to Stennis propulsion test operations.&amp;nbsp; A detailed methodology
    for determining the replacement solvent was devised and implemented during this
    project.&amp;nbsp;&amp;nbsp; In reality, parts undergoing cleaning are not able
    to be inspected internally to determine a cleanliness level.&amp;nbsp; Therefore,
    a test rig that could be disassembled with complicated internal geometry was made
    using several computer aided design iterations. The test fixture disassembly allows
    for the inspection of the internals following the use of the cleaning solvent.&amp;nbsp;
    The contamination solution is made of various items that are used in the propulsion
    test environment.&amp;nbsp; Upon &amp;ldquo;dirtying&amp;rdquo; the test rig, a
    thorough post processing inspection exercise procedure was devised to be used when
    evaluating alternative solvents.&lt;/strong&gt;&lt;/p&gt;",nt"license_title":
